    "2013-03-19T00:34:02.724660",nt"name": "interpretive-bedrock-geologic-map-of-the-sagavanirktok-b-1-quadrangle-eastern-north-slope-alask",nt"isopen":
    false,nt"url": null,nt"notes": "Alaska Division of Geological & Geophysical
    Surveys (DGGS) has conducted 1:63,360-scale geologic mapping of the Sagavanirktok
    B-1 Quadrangle (640 square kmu0097equivalent to four 7.5 minute quadrangles). This
    mapping project reinterprets micropaleontologic correlations for 17 Sagavanirktok
    Quadrangle wells, and reprocesses data from the one publicly-available seismic line.
    Surface geologic mapping, subsurface-to-surface stratigraphic age control, and seismic
    framework are required to reliably decipher the complex geology of this key area
    of the Brooks Range. Outcrops within the Sagavanirktok B-1 Quadrangle are the closest
    surface expressions of Prudhoe Bay source and reservoir rocks. This study yields
    critical petroleum-related information from these surface exposures, and how they
    relate to the area subsurface stratigraphy.",nt"license_title": null,nt"extras":
